export default {
	CriarProjeto: async () => {
			await CriarProjetoAPI.run({ projetoDados : {'titulo' : Input1.text, 'contrato' : Input2.text, 'num_sap': Input3.text,
																							 'id_coordenador' : Select1.selectedOptionValue, 'id_proponente' : Select2.selectedOptionValue } }).then(res => {
				showAlert(res)
				navigateTo("Projetos")
			}).catch( () => {
							showAlert("Erro ao criar projeto")
			})
	},

	LoadPage: async () => {
			let data = await LoadFavorecidosAPI.run().catch(() => { showAlert("Erro na requisição dos dados") })

			let lista_favorecidos = []

			for(var e of data) {
					lista_favorecidos.push({'label': e['nome'], 'value': e['id']})
			}

			await storeValue("favorecidos", lista_favorecidos)
	}
}
